text_show:
Kaore e taea e matou te mahi i nga tae e whakaatuhia ana i te ahua, engari he papanga tae hoki hei whiriwhiri maau ki te whakatutuki i o hiahia tae.
Kore-whakarereke, he watea ki te takai mo te rokiroki me te ngawari ki te kakahu makuku, engari kaua e tino mirimiri, kaua e pangia, e rinohia ranei. Ka taea te whakamahi hei papapu tepu, hei kaihoroi teepu ranei, ka taea hoki te pai mo o whanau me o hoa. He pai mo te nuinga o nga papa. mo nga paati, hararei, huihuinga, marena, ka taea hoki te pai mo o whanau me o hoa.
1.Non-paitini me te hongi;
ngawari me te roa, kaore i te ngawari ki te pakaru i te mata o nga taonga;
ka taea te takai me te penapena hei whakaora i te waahi;
he haumaru mo nga kaumatua, tamariki me nga kararehe.
2.Ka taea te horoi me te tere-tae
He tino watea hoki ki te horoi ringa ki te wai matao tika ina paru ana.
I muri i te horoinga, ka taea e koe te horahia ka whakairihia kia maroke.
He ahua ma me te hou kaore e memeha.
